import React from 'react';
import { Link } from 'react-router-dom';
import { Drawer, List, ListItem, ListItemText, ListItemIcon } from '@mui/material';
import FolderIcon from '@mui/icons-material/Folder';
import AddIcon from '@mui/icons-material/Add';
import ReportIcon from '@mui/icons-material/Assessment';
import LoginIcon from '@mui/icons-material/Login';

const Sidebar = () => {
    return (
        <Drawer variant="permanent" anchor="left">
            <List>
                <ListItem button component={Link} to="/">
                    <ListItemIcon>
                        <FolderIcon />
                    </ListItemIcon>
                    <ListItemText primary="Adıma Açılan Dofler" />
                </ListItem>
                <ListItem button component={Link} to="/dof-ac">
                    <ListItemIcon>
                        <AddIcon />
                    </ListItemIcon>
                    <ListItemText primary="Dof Aç" />
                </ListItem>
                <ListItem button component={Link} to="/rapor-calistir">
                    <ListItemIcon>
                        <ReportIcon />
                    </ListItemIcon>
                    <ListItemText primary="Rapor Çalıştır" />
                </ListItem>
                <ListItem button component={Link} to="/login">
                    <ListItemIcon>
                        <LoginIcon />
                    </ListItemIcon>
                    <ListItemText primary="Giriş Yap" />
                </ListItem>
            </List>
        </Drawer>
    );
};

export default Sidebar;
